import React from 'react';

function EnrollButton({ onClick }) {
  return (
    <div className="a">
      <div className="enroll">
        <button className="enroll-button" onClick={onClick}>C'est parti!</button>
      </div>
    </div>
  );
}

export default EnrollButton;
